import React from 'react';
import user from '../Img/user.png';
import doc from '../Img/doc.png';
import tech from '../Img/tech.png';


function Who() {
    return (
        <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
            <div style={{ display: 'flex', flexDirection: 'row', justifyContent: 'center', width: '100%', gap: '20px' }}>
                {/* First two cards */}
                <div className="card text-bg-light mb-3" style={{ maxWidth: '35rem' }}>
                    <div className="card-body">
                        <a className="card-title" href='#'><img src={user}/></a>
                        <h3 style={{textAlign:'center'}}>Normal User</h3>
                    </div>
                </div>
                <div className="card text-bg-light mb-3" style={{ maxWidth: '18rem' }}>
                <div className="card-body">
                        <a className="card-title" href='#'><img src={user}/></a>
                        <h3 style={{textAlign:'center'}}>Normal User</h3>
                    </div>
                </div>
            </div>
            {/* Third card on a new line */}
            <div style={{ display: 'flex', flexDirection: 'row', justifyContent: 'center', width: '100%', gap: '20px' }}>
                <div className="card text-bg-light mb-3" style={{ maxWidth: '18rem' }}>
                    <div className="card-body">
                        <h5 className="card-title">Light card title</h5>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Who;
